import styled from 'styled-components';

const Styled = styled.div`
    input {
        padding: 0;
        border: none;
        border-radius: 0;
        border-bottom: 1px dotted #333;
        margin-left: 0;
        width: 100%;
        outline: none;
    }

    input:focus {
        box-shadow: none;
    }

    .ant-form-item {
        margin-bottom: 15px;
    }

    .ant-row.ant-form-item-row {
        display: flex;
        flex-direction: row;
        flex-wrap: nowrap;
        align-items: center;
    }

    .ant-col.ant-form-item-control {
        flex: 1;
    }
`;
export default Styled;
